INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at, entity_type) VALUES (80, '81cc24546e5ed2c5d4737d051615a7bf78001911ed74f95fd985e33106bf868c', 'Керамическая ваза-осьминог', 'Оригинальная керамическая ваза в форме осьминога фиолетового цвета. Изделие выполнено вручную с детальной проработкой щупалец и текстуры. Имеет глянцевое покрытие. Можно использовать как вазу или декоративный элемент интерьера. Размер примерно 20х20 см.', 10207, 0.9000, 'Керамическая ваза-осьминог является декоративным предметом, изготовленным из природного материала - керамики. Она подходит для категории ''Природные материалы'', так как описывается как оригинальный декоративный элемент интерьера.', NULL, 'claude-3-haiku-20240307', 1394, NULL, NULL, NULL, false, NULL, NULL, '2025-10-02 09:27:42.08994', '2025-10-02 09:27:42.08994', 'listing');
INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at, entity_type) VALUES (81, 'c86f7ebdc6a21345b76aea2330d2b81c2cdae210d0b3b2f7f79565a6308b7908', 'Интерьерная кукла ручной работы', 'Очаровательная интерьерная кукла ручной работы в зимнем стиле. Одета в белый свитер Champion, клетчатую юбку, белые ботиночки и вязаную шапочку с помпонами. В комплекте идет маленький плюшевый мишка и сумочка через плечо. Кукла выполнена из высококачественных материалов, прекрасно подойдет для украшения интерьера или коллекции.', 10205, 0.9000, 'Товар представляет собой интерьерную куклу ручной работы, которая подходит для коллекционирования и украшения интерьера. Описание товара указывает на его ценность как предмета коллекционирования, поэтому категория ''Коллекционирование'' является наиболее подходящей.', NULL, 'claude-3-haiku-20240307', 1555, NULL, NULL, NULL, false, NULL, NULL, '2025-10-02 14:02:59.95926', '2025-10-02 14:02:59.95926', 'listing');
