INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at, entity_type) VALUES (102, '1a481570acac557a44fe13056ee5d6c5b9bb4606849ee9c9d6c70bf84a2c743f', 'Smart ForTwo Matte Black Edition', 'Smart ForTwo in excellent condition with custom matte black wrap. Features distinctive 5-spoke alloy wheels with silver accents. Compact city car perfect for urban driving and easy parking. Modern design with panoramic glass roof and premium finish.', 1301, 0.9000, 'Товар представляет собой автомобиль Smart ForTwo с особым матовым черным покрытием. Он описывается как компактный городской автомобиль для удобного вождения и парковки, что соответствует категории ''Lični automobili'' или легковые автомобили.', NULL, 'claude-3-haiku-20240307', 1473, 'automotive', 'city car', '{smart,fortwo,"compact car","city vehicle"}', false, NULL, NULL, '2025-10-03 13:38:02.0471', '2025-10-03 13:38:02.0471', 'product');
