INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at, entity_type) VALUES (111, '58c49a08154f05170053d2e77ffd53ea9d9298add52b19a32f7fd760fdabbb0e', 'Modern Upholstered Dining Chair', 'Modern dining chair in excellent condition featuring beige/grey upholstery. High-back design with comfortable padding throughout. Wooden legs with a light finish. Clean lines and contemporary styling perfect for dining room or kitchen settings.', 1501, 0.9500, 'Данный товар является современным обеденным стулом с мягкой обивкой, что четко соответствует категории мебели.', NULL, 'claude-3-haiku-20240307', 1064, 'home', 'chair', '{"dining chair","kitchen chair",upholstered,seating}', false, NULL, NULL, '2025-10-03 16:33:24.170986', '2025-10-03 16:33:24.170986', 'product');
INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at, entity_type) VALUES (114, '872d529f5771ae4482b989cf80da29d55459dbfde4d179d7b996a2a8afca7d68', 'Smart ForTwo Matte Grey', 'Smart ForTwo automobil u mat sivoj boji, očuvan i u odličnom stanju. Poseduje sportske felne sa pet krakova, zatamljena stakla, i aerodinamični body kit. Automobil je modernog izgleda sa prepoznatljivim Smart dizajnom i kompaktnim dimenzijama idealnim za gradsku vožnju.', 1301, 0.9500, 'Описание товара четко указывает, что это автомобиль - Smart ForTwo в матовом сером цвете, с дополнительными спортивными элементами. Это относится к категории личных/легковых автомобилей.', NULL, 'claude-3-haiku-20240307', 1333, NULL, NULL, NULL, false, NULL, NULL, '2025-10-03 17:33:07.556088', '2025-10-03 17:33:07.556088', 'listing');
INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at, entity_type) VALUES (115, '64a4e49d5304f21c55d13d3bf0693f120b2ab19b5ec88291e9fce648884d66b4', 'Volkswagen Touran 2.0 TDI', 'Volkswagen Touran u odličnom stanju, sa 2.0 TDI motorom. Auto je u sivoj metalik boji, sa panoramskim krovom i aluminijumskim felnama. Poseduje sve moderne karakteristike uključujući klima uređaj, električne prozore i retrovizore. Registarske oznake ukazuju da je vozilo iz Beograda.', 1301, 0.9500, 'Описание товара четко указывает, что это автомобиль Volkswagen Touran с 2.0 TDI двигателем, что соответствует категории ''Lični automobili''.', NULL, 'claude-3-haiku-20240307', 1256, NULL, NULL, NULL, false, NULL, NULL, '2025-10-03 17:33:40.726991', '2025-10-03 17:33:40.726991', 'listing');
INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at, entity_type) VALUES (116, '975fe85d594636992e0a4ccf9f07b1a76af3bb407c7adf940890bde64da91d62', 'Trpezarijska stolica sa tapaciranim sedištem', 'Moderna trpezarijska stolica sa kvalitetnim tapacirungom u svetlo sivoj boji. Izrađena od čvrstog drveta sa udobnim sedištem presvučenim kvalitetnom tkaninom. Stolica je u odličnom stanju, bez oštećenja i mrlja. Elegantnog je dizajna koji se lako uklapa u različite enterijere.', 1501, 0.9000, 'Данный товар представляет собой трапезную стулья, которые являются мебелью для дома и офиса. Описание четко указывает на то, что это мебельное изделие, поэтому категория ''Мебель'' является наиболее подходящей.', NULL, 'claude-3-haiku-20240307', 1650, NULL, NULL, NULL, false, NULL, NULL, '2025-10-03 17:36:16.360382', '2025-10-03 17:36:16.360382', 'listing');
INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at, entity_type) VALUES (117, '24828417e2496b43810431feb370a7e64217df8155d9d255a2101524d32db24e', 'Trpezarijska stolica tapacirana', 'Elegantna trpezarijska stolica u bež boji. Izrađena od kvalitetnog materijala sa tapaciranim sedištem i naslonom u tekstilu nalik filcu. Drvene noge u prirodnoj boji. Stolica je u odličnom stanju, pogodna za trpezariju ili kancelarijski prostor. Minimalistički dizajn koji se uklapa u različite enterijere.', 1501, 0.9000, 'Описание товара подходит под категорию мебели, а именно стульев для трапезной или офисного пространства. Дизайн и материалы описываются как подходящие для этой категории.', NULL, 'claude-3-haiku-20240307', 1696, NULL, NULL, NULL, false, NULL, NULL, '2025-10-03 17:39:03.713272', '2025-10-03 17:39:03.713272', 'listing');
INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at, entity_type) VALUES (118, '63291c82ff7eee5cb42669313da26bace9af82c01b705ce835e444c76652b0a9', 'PlayStation 5 Gaming Console', 'PlayStation 5 gaming console in white color. The console appears to be in good condition, standing vertically on what seems to be a wooden surface. This appears to be the disc drive version based on the visible disc slot.', 1105, 0.9800, 'The product description clearly indicates that this is a PlayStation 5 gaming console, which falls under the ''Gaming Consoles'' category.', NULL, 'claude-3-haiku-20240307', 1074, 'electronics', 'gaming console', '{playstation,ps5,gaming,console,sony}', false, NULL, NULL, '2025-10-03 17:42:03.319501', '2025-10-03 18:09:13.133749', 'product');
INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at, entity_type) VALUES (120, 'c54b0ab9a28e8c8bd64a0d646ddca34b908bd62ebdf18714ce15e15d87829818', 'Huawei WiFi Ruter', 'Huawei WiFi ruter u odličnom stanju. Uređaj poseduje dve eksterne antene za bolji prijem signala, perforiran dizajn za bolje hlađenje i LED indikatore za status. Podržava dual-band tehnologiju i ima više LAN portova za žičano povezivanje. Ruter je u beloj boji i idealan je za kućnu ili kancelarijsku upotrebu.', 1107, 0.9000, 'Товар является Wi-Fi роутером, который относится к категории Умный Дом. Он обладает функциями для улучшения Wi-Fi покрытия, что соответствует ключевым характеристикам данной категории.', NULL, 'claude-3-haiku-20240307', 1372, NULL, NULL, NULL, false, NULL, NULL, '2025-10-05 19:13:14.84881', '2025-10-05 19:13:14.84881', 'listing');
INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at, entity_type) VALUES (121, '6093bf83e5dc8a44ff07f8074b3cd27c2959dd912db0fd93d67ab715be4e1c28', 'Электрическая отвертка Xiaomi', 'Электрическая отвертка Xiaomi в металлическом корпусе серого цвета. Комплект включает 6 сменных бит и зарядное устройство. Компактный дизайн, удобное хранение насадок в корпусе. Отвертка выполнена в минималистичном стиле, характерном для продукции Xiaomi.', 1108, 0.9000, 'Описание товара указывает на то, что это электрическая отвертка, относящаяся к категории электронных аксессуаров. Товар включает в себя сменные насадки и зарядное устройство, что характерно для данной категории.', NULL, 'claude-3-haiku-20240307', 1350, NULL, NULL, NULL, false, NULL, NULL, '2025-10-05 21:37:52.991539', '2025-10-05 21:37:52.991539', 'listing');
INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at, entity_type) VALUES (122, 'fda700c45aaa3c17af8376eef8bce285da3fcd55ffe2221473ba9695530f4e11', 'Gray Upholstered Dining Chair', 'Contemporary dining chair featuring light gray upholstery in a textured fabric finish. Solid wooden legs with a natural finish. High backrest design for comfort. Chair appears to be in excellent condition with clean upholstery and sturdy construction. Modern minimalist style suitable for dining room or kitchen use.', 1501, 0.9500, 'Товар представляет собой современный обеденный стул с текстурированной серой обивкой и деревянными ножками, что соответствует категории мебели.', NULL, 'claude-3-haiku-20240307', 1336, NULL, NULL, NULL, false, NULL, NULL, '2025-10-08 09:43:26.527012', '2025-10-08 09:43:26.527012', 'listing');
INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at, entity_type) VALUES (123, 'e9afc9ce8e3fe0ecf8059fba0fcf9b3e746802641781c5bdbd8e1b3433ea91de', 'PlayStation 5 игровая консоль', 'Игровая консоль PlayStation 5 в белом корпусе, вертикальное расположение. Консоль в хорошем состоянии. Версия Digital Edition (без дисковода). Стильный современный дизайн с характерными черно-белыми элементами корпуса.', 1105, 0.9500, 'Товар является игровой консолью PlayStation 5, которая относится к категории игровых консолей.', NULL, 'claude-3-haiku-20240307', 1459, NULL, NULL, NULL, false, NULL, NULL, '2025-10-08 19:34:33.434998', '2025-10-08 19:34:33.434998', 'listing');
INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at, entity_type) VALUES (124, '53ed32dcc0ead23d87cbc05ef0beeca74ec71d04f23477529b1379a1481026eb', 'Xiaomi электрическая отвертка набор', 'Электрическая отвертка Xiaomi в металлическом корпусе серого цвета. В комплект входит 6 сменных насадок-бит различного размера. Компактный дизайн с удобным хранением насадок в корпусе. Устройство новое, в отличном состоянии, выполнено из качественного алюминиевого сплава.', 10232, 0.9500, 'Данный товар представляет собой электрическую отвертку, которая является строительным инструментом. Поэтому наиболее подходящей категорией для него будет ''Строительные инструменты''.', NULL, 'claude-3-haiku-20240307', 1324, NULL, NULL, NULL, false, NULL, NULL, '2025-10-09 09:17:23.899194', '2025-10-09 09:17:23.899194', 'listing');
INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at, entity_type) VALUES (126, 'bd2fde076c1d32c2d77a4dd750277b94d9da2ecf2db1ee426a5393a726a0a74c', 'Frosted Glass Carafes on Beach', 'Set of two elegant frosted glass carafes with narrow necks, containing what appears to be a light amber liquid. Photographed on a pebbly beach with colorful stones and ocean water in the background. The bottles have a modern, minimalist design with frosted finish.', 2006, 0.9000, 'Описание товара указывает на фотографическое изображение стеклянных графинов, которое, вероятно, предназначено для использования в качестве декоративного или художественного элемента. Таким образом, наиболее подходящей категорией является ''photo''.', NULL, 'claude-3-haiku-20240307', 1533, 'home', 'glassware', '{carafe,decanter,glass,bottle}', false, NULL, NULL, '2025-10-10 20:36:17.305086', '2025-10-10 20:36:17.305086', 'product');
INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at, entity_type) VALUES (128, '279c2165e75cdf4eccbc74cb81567299502212222b0224b28b73da59d596e174', 'PlayStation 5', 'Игровая приставка PlayStation 5 в белом корпусе. Модель Digital Edition (без дисковода). Консоль в хорошем состоянии, полностью рабочая. Современная игровая система с поддержкой 4K-графики, быстрой загрузкой игр и инновационным геймпадом DualSense.', 1105, 0.9500, 'The product described is a PlayStation 5 gaming console, which belongs in the ''Gaming Consoles'' category. The description mentions it is a modern gaming system with 4K graphics support, fast game loading, and a DualSense controller, which are all characteristics of a gaming console.', NULL, 'claude-3-haiku-20240307', 1487, NULL, NULL, NULL, false, NULL, NULL, '2025-10-11 17:38:29.562942', '2025-10-11 17:38:29.562942', 'listing');
